import React from 'react';
import ReturnAcTif from './Actif';
import FadeLoader from 'react-spinners/FadeLoader';
import { useNavigate } from 'react-router-dom';

// Return Actif
export default function ActiF() {

 const navigation = useNavigate();
 const [loading, setLoading] = React.useState(true);

 React.useEffect(() => {

  JSON.parse(window.localStorage.getItem('ACTIVE')) !== true && navigation('/');
  window.setTimeout(() => {
   setLoading(false);
  }, 7600);

 }, []);

 return (
  <div>
   {loading && <div className='App-loading-Actif'></div>}
   {loading && <div className='App-Icon'>

    <FadeLoader
     size={15}
     color={'#00b8d4'}
     loading={loading}
    />

   </div>}

   <ReturnAcTif />
  </div>
 );
};
